import React, { Component } from 'react';
import './Styles/Navbar.css';
import Logo from './Images/logo.png'

class Navbar extends Component {
    render() {
        return (
            <div id="Navbar">
                    <div id="Logo"><img id="LogoImage" src={Logo}/></div>
                    <div id="NavLinks">
                        <div className="Navitem"><a href="#About">About</a></div>
                        <div className="Navitem"><a>Products</a></div>
                        <div className="Navitem"><a>Queries</a></div>
                        <div className="Navitem"><a>Images</a></div>
                        <div className="Navitem"><a>Contact</a></div>
                    </div>
            </div>
        );
    }
}

export default Navbar;
